import React from 'react'
import logo from "../Image/logo.png";
export default function Signup7() {

      const list = [
            {
              id: 'a',
              firstname: 'Robin',
              lastname: 'Wieruch',
              year: 1988,
            },
            {
              id: 'b',
              firstname: 'Dave',
              lastname: 'Davidds',
              year: 1990,
            }
          ]

              {list.map(item => {
                return (
                  <li
                    key={item.id}
                    style={{ height: '250px', border: '1px solid black' }}
                  >
                    <div>{item.id}</div>
                    <div>{item.firstname}</div>
                    <div>{item.lastname}</div>
                    <div>{item.year}</div>
                  </li>
                );
              })}




}
